import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

function Header({ cartitems }) {
  return (
    <>
      {cartitems.map((item) => {
        return(
         <p> {item.quantity}</p>
        )
      })}
      <header className="header">
        <div>
          <h1>
            <Link>Shoping CArt</Link>
          </h1>
        </div>
        <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
          </ul>
          <ul>
            <li>
              <Link to="/cart">Cart</Link>
            </li>
          </ul>
        </div>
      </header>
    </>
  );
}

export default Header;
